                        border: none;
                        border-top: 1px solid black;
                        margin: 0;
                    }
        
                    .logo {
                        position: absolute;
                        top: 10px;
                        left: 10px;
                        width: 150px;
                        height: 150px;
                    }
                    
                    .qr {
                        position: absolute;
                        bottom: 40px;
                        left: 10px;
                        width: 150px;
                        height: 150px;
                    }

                    .header {
                        position: relative;
                        display: flex;
                        justify-content: space-between;
                        align-items: center;
                        height: 80px;
                        margin: 1cm;
                    }
        
                    .header-left {
                        position: absolute;
                        left: 13%;
