                        width: auto;
                        height: 100%;
                        font-size: 12px;
                        color: #555;
                    }
        
                    .header-right {
                        position: relative;
                        right: 30%;
                        left: 60%;                        
                        top: -30px;
                        width: auto;
                        height: 100%;
                        font-size: 12px;
                        color: #555;
                    }
        
                    .header-info {
                        margin-top: 50px;
                    }
        
                    .comprobante,
                    .fecha {
                        margin: 0 20px;
                    }
        
                    .comprobante {
                        margin-left: 0;
                    }
                    
                    .comprobante strong {
                        font-weight: bold;
                    }
                    
                    .comprobante.razon-social {
                        font-size: 22px;
                        text-align: center;
                    }
                    
                    .comprobante.factura {
                        font-size: 22px;
                        text-align: left;
                    }
                              
                    .datos-factura {
                        font-size: 12px;
                        border-top: 1px solid black; /* Agregamos un borde superior */
                        margin-top: 10px;
                    }
                    
                    .datos-factura p {
                        display: inline-block;
                        margin: 5px 0;
                    }
                    
                    .datos-cliente {
                        font-size: 12px;
                        border-top: 1px solid black; /* Agregamos un borde superior */
                        margin-top: 10px;
