                    }
        
                    .detalle-factura td {
                        font-size: 12px;
                        color: #000;
                        text-align: left;
                    }
        
                    .detalle-factura td:nth-child(1) {
                        text-align: center;
                    }
        
                    .detalle-factura td:nth-child(3),
                    .detalle-factura td:nth-child(4) {
                        text-align: right;
                    }
        
                    .detalle-factura th:nth-child(1),
                    .detalle-factura th:nth-child(4),
                    .detalle-factura td:nth-child(1),
                    .detalle-factura td:nth-child(4) {
                        border-left: none;
                        border-right: none;
                    }
        
                    .footer {
                        position: fixed;
                        bottom: 3cm;
                        left: 0;
                        right: 0;
                        height: 4cm;
                        /*background-color: #f7f7f7;*/
