                        <th>Descripcion</th>
                        <th>Precio unitario</th>
                        <th>Importe</th>
                    </tr>
                    </thead>
                    <tbody>
                    <tr>
                        <td>1</td>
                        <td>$descripcion</td>
                        <td>$subtotal</td>
                        <td>$subtotal</td>
                    </tr>
                    </tbody>
                </table>
                <div class="footer">
                    <table>
                        <tr>
                            <th>Subtotal:</th>
                            <td>$subtotal</td>
                        </tr>
                        <tr>
                            <th>Importe Otros Tributos:</th>
                            <td>$otros_tributos</td>
                        </tr>
                        <tr>
                            <th>Importe Total:</th>
                            <td>$importe_total</td>
                        </tr>
                    </table>
                    <div class="datos-adicionales-footer">
                        <p class="comprobante">CAE N: $cae</p>
                        <p class="comprobante">Fecha de Vto. de CAE: $fecha_vto_cae</p>
                    </div>
                    <div class="page-number"></div>
                </div>
                <!-- Incrustar el cdigo QR en el PDF --> 
                <div class = "qr">
                   <img id="qrcode" src="$qr_base64" alt="QR Code" width="180" height="180">
                </div>    
            </body>
        </html>
        HTML;

            // Crear una instancia de Dompdf
            $dompdf = new Dompdf();

            // Cargar el HTML en Dompdf
            $dompdf->loadHtml(mb_convert_encoding($html_comprobante, 'HTML-ENTITIES', 'UTF-8'));
            $dompdf->loadHtml($html_comprobante);

            $dompdf->setPaper('A4', 'portrait');

            // Renderizar el PDF
            $dompdf->render();

            // Generar el PDF con dompdf
            $dompdf->stream("comprobante_".$numero.".pdf");

            // Obtener el contenido del PDF generado
            $pdf_content = $dompdf->output();

            // Limpiar el bfer de salida
            ob_end_clean();

            // Configurar los encabezados para la descarga del archivo
            header('Content-Description: File Transfer');
            header('Content-Type: application/pdf');
            header('Content-Disposition: attachment; filename="comprobante_'.$numero.'.pdf"');
            header('Content-Length: ' . strlen($pdf_content));
            header('Cache-Control: private, no-cache, no-store, must-revalidate');
            header('Pragma: no-cache');
            header('Expires: 0');

            // Enviar el contenido del PDF como un archivo descargable
            echo $pdf_content;
        }
    }
